import React from "react";
const InputField = (props) => {
  const overRideStyle = {
    bakgroundColor: "#008CBA",
  };
  return (
    <div>
      <input
        type="text"
        value={props.todo}
        onChange={(event) => {
          props.setTodo(event.target.value);
        }}
      />
      <button
        style={overRideStyle}
        className="button"
        onClick={() => props.addTodos()}
      >
        +
      </button>
    </div>
  );
};

export default InputField;
